SRSASN_CODE drbs_to_be_setup_item_ext_ies_container::pack(bit_ref& bref) const
{
  uint32_t nof_ies = 1;
  nof_ies += dc_based_dupl_cfgured_present ? 1 : 0;
  nof_ies += dc_based_dupl_activation_present ? 1 : 0;
  nof_ies += ulpdcpsn_len_present ? 1 : 0;
  pack_length(bref, nof_ies, 1u, 65535u, true);

  if (dc_based_dupl_cfgured_present) {
    HANDLE_CODE(dc_based_dupl_cfgured.pack(bref));
  }
  if (dc_based_dupl_activation_present) {
    HANDLE_CODE(dc_based_dupl_activation.pack(bref));
  }
  HANDLE_CODE(dlpdcpsn_len.pack(bref));
  if (ulpdcpsn_len_present) {
    HANDLE_CODE(ulpdcpsn_len.pack(bref));
  }

  return SRSASN_SUCCESS;
}
SRSASN_CODE drbs_to_be_setup_item_ext_ies_container::unpack(cbit_ref& bref)
{
  uint32_t nof_ies = 0;
  unpack_length(nof_ies, bref, 1u, 65535u, true);

  uint32_t nof_mandatory_ies = 1;

  for (; nof_ies > 0; --nof_ies) {
    uint32_t id;
    HANDLE_CODE(unpack_integer(id, bref, (uint32_t)0u, (uint32_t)65535u, false, true));
    switch (id) {
      case 176: {
        dc_based_dupl_cfgured_present = true;
        dc_based_dupl_cfgured.id      = id;
        HANDLE_CODE(dc_based_dupl_cfgured.crit.unpack(bref));
        varlength_field_unpack_guard varlen_scope(bref, true);
        HANDLE_CODE(dc_based_dupl_cfgured.ext.unpack(bref));
        break;
      }
      case 177: {
        dc_based_dupl_activation_present = true;
        dc_based_dupl_activation.id      = id;
        HANDLE_CODE(dc_based_dupl_activation.crit.unpack(bref));
        varlength_field_unpack_guard varlen_scope(bref, true);
        HANDLE_CODE(dc_based_dupl_activation.ext.unpack(bref));
        break;
      }
      case 161: {
        nof_mandatory_ies--;
        dlpdcpsn_len.id = id;
        HANDLE_CODE(dlpdcpsn_len.crit.unpack(bref));
        varlength_field_unpack_guard varlen_scope(bref, true);
        HANDLE_CODE(dlpdcpsn_len.ext.unpack(bref));
        break;
      }
      case 192: {
        ulpdcpsn_len_present = true;
        ulpdcpsn_len.id      = id;
        HANDLE_CODE(ulpdcpsn_len.crit.unpack(bref));
        varlength_field_unpack_guard varlen_scope(bref, true);
        HANDLE_CODE(ulpdcpsn_len.ext.unpack(bref));
        break;
      }
      default:
        asn1::log_error("Unpacked object ID=%d is not recognized\n", id);
        return SRSASN_ERROR_DECODE_FAIL;
    }
  }
  if (nof_mandatory_ies > 0) {
    asn1::log_error("Mandatory fields are missing\n");

    return SRSASN_ERROR_DECODE_FAIL;
  }
  return SRSASN_SUCCESS;
}
